import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth, TIERS } from '../context/AuthContext';
import { Check, X, Crown, Star, Sparkles, ArrowLeft } from 'lucide-react';

const PLANS = [
  {
    id: TIERS.FREE,
    name: 'Free',
    price: 0,
    period: '',
    description: 'Get started with basics',
    icon: 'ðŸŒ±',
    color: '#6b7280',
    features: [
      { text: 'Basic Dashboard', included: true },
      { text: 'Prayer Times', included: true },
      { text: 'Salah Tracking & History', included: false },
      { text: '5 Surahs to Read', included: true },
      { text: 'Full Quran (114 Surahs)', included: false },
      { text: 'Memorization Plans', included: false },
      { text: 'Musabaqah Quiz', included: false },
      { text: 'Tajweed Lessons', included: false },
      { text: '3 Habits Max', included: true },
      { text: 'Workout Tracking', included: false },
      { text: 'Custom PDF Workout', included: false },
      { text: 'Weight Tracking', included: false },
    ]
  },
  {
    id: TIERS.PRO,
    name: 'Pro',
    price: 4.99,
    period: '/month',
    description: 'Everything you need',
    icon: 'ðŸŒŸ',
    color: '#d4af37',
    popular: true,
    features: [
      { text: 'Full Dashboard', included: true },
      { text: 'Prayer Times', included: true },
      { text: 'Salah Tracking & History', included: true },
      { text: 'Full Quran (114 Surahs)', included: true },
      { text: 'Memorization Plans', included: true },
      { text: 'Revision System', included: true },
      { text: 'Musabaqah Quiz', included: true },
      { text: 'Tajweed Lessons', included: true },
      { text: 'Unlimited Habits', included: true },
      { text: 'Default Workout Plan', included: true },
      { text: 'Custom PDF Workout', included: false },
      { text: 'Weight Tracking', included: false },
    ]
  },
  {
    id: TIERS.PRO_PLUS,
    name: 'Pro+',
    price: 9.99,
    period: '/month',
    description: 'Complete experience',
    icon: 'â­',
    color: '#8b5cf6',
    features: [
      { text: 'Everything in Pro', included: true },
      { text: 'Full Dashboard', included: true },
      { text: 'Salah Tracking & History', included: true },
      { text: 'Full Quran (114 Surahs)', included: true },
      { text: 'Memorization Plans', included: true },
      { text: 'Revision System', included: true },
      { text: 'Musabaqah Quiz', included: true },
      { text: 'Tajweed Lessons', included: true },
      { text: 'Unlimited Habits', included: true },
      { text: 'Full Workout Tracking', included: true },
      { text: 'Custom PDF Workout Import', included: true },
      { text: 'Weight Tracking & History', included: true },
    ]
  }
];

function Pricing() {
  const { user, userProfile, updateTier } = useAuth();
  const navigate = useNavigate();
  const [loading, setLoading] = useState(null);

  const currentTier = userProfile?.tier || TIERS.FREE;

  const handleSelectPlan = async (planId) => {
    if (!user) {
      navigate('/signup');
      return;
    }

    if (planId === currentTier) return;

    // For paid plans, redirect to payment (Stripe)
    if (planId !== TIERS.FREE) {
      setLoading(planId);
      // TODO: Implement Stripe checkout
      // For now, simulate upgrade
      setTimeout(async () => {
        await updateTier(planId);
        setLoading(null);
        alert(`Upgraded to ${PLANS.find(p => p.id === planId)?.name}! ðŸŽ‰`);
      }, 1500);
    } else {
      await updateTier(planId);
    }
  };

  return (
    <div className="pricing-page">
      <button className="back-btn" onClick={() => navigate(-1)}>
        <ArrowLeft size={20} />
        Back
      </button>

      <div className="pricing-header">
        <Sparkles className="header-icon" size={32} />
        <h1>Choose Your Plan</h1>
        <p>Unlock your full potential with Qawaam</p>
      </div>

      <div className="plans-grid">
        {PLANS.map((plan) => {
          const isCurrentPlan = plan.id === currentTier;
          const isLoading = loading === plan.id;

          return (
            <div 
              key={plan.id} 
              className={`plan-card ${plan.popular ? 'popular' : ''} ${isCurrentPlan ? 'current' : ''}`}
              style={{ '--plan-color': plan.color }}
            >
              {plan.popular && (
                <div className="popular-badge">
                  <Star size={12} /> Most Popular
                </div>
              )}

              {isCurrentPlan && (
                <div className="current-badge">
                  Current Plan
                </div>
              )}

              <div className="plan-header">
                <span className="plan-icon">{plan.icon}</span>
                <h2>{plan.name}</h2>
                <p className="plan-desc">{plan.description}</p>
              </div>

              <div className="plan-price">
                <span className="currency">$</span>
                <span className="amount">{plan.price}</span>
                <span className="period">{plan.period}</span>
              </div>

              <ul className="features-list">
                {plan.features.map((feature, i) => (
                  <li key={i} className={feature.included ? 'included' : 'excluded'}>
                    {feature.included ? (
                      <Check size={16} className="check" />
                    ) : (
                      <X size={16} className="x" />
                    )}
                    <span>{feature.text}</span>
                  </li>
                ))}
              </ul>

              <button
                className={`plan-btn ${isCurrentPlan ? 'current' : ''}`}
                onClick={() => handleSelectPlan(plan.id)}
                disabled={isCurrentPlan || isLoading}
              >
                {isLoading ? (
                  <span className="loader"></span>
                ) : isCurrentPlan ? (
                  'Current Plan'
                ) : plan.price === 0 ? (
                  'Get Started'
                ) : (
                  <>
                    <Crown size={16} />
                    Upgrade to {plan.name}
                  </>
                )}
              </button>
            </div>
          );
        })}
      </div>

      <div className="pricing-footer">
        <p>ðŸ”’ Secure payment powered by Stripe</p>
        <p>Cancel anytime â€¢ No hidden fees</p>
      </div>

      <style>{`
        .pricing-page {
          min-height: 100vh;
          padding: 20px;
          padding-bottom: 100px;
